package com.sia.scheduler.log.enums;public enum LogStatusEnum {    /**     * 日志类型     * LOG_JOB_ENDTASK_FINISHED：虚拟endTask运行结束     * LOG_JOB_HANDLE_BEGIN：Job运行开始     * LOG_JOB_HANDLE_FAIL_STOP：Job运行失败，策略为STOP     * LOG_JOB_FAIL_MULTI_CALLS：Job运行失败，策略为MULTI_CALLS     * LOG_JOB_FAIL_MULTI_CALLS_TRANSFER：Job运行失败，策略为MULTI_CALLS_TRANSFER     * LOG_JOB_FAIL_TRANSFER：Job运行失败，策略为TRANSFER     * LOG_JOB_FAIL_IGNORE：Job运行失败，策略为IGNORE     */    LOG_JOB_ENDTASK_FINISHED,    LOG_JOB_HANDLE_BEGIN,    LOG_JOB_HANDLE_FAIL_STOP,    LOG_JOB_FAIL_MULTI_CALLS,    LOG_JOB_FAIL_MULTI_CALLS_TRANSFER,    LOG_JOB_FAIL_TRANSFER,    LOG_JOB_FAIL_IGNORE,    /**     * 定义task调度日志标识     */    LOG_TASK_END_FINISHED,    LOG_TASK_FINISHED,    LOG_TASK_CALLBACKERROR,    LOG_TASK_HANDLE_BEGIN,    LOG_TASK_FAIL_STOP,    LOG_TASK_FAIL_IGNORE,    LOG_TASK_FAIL_MULTI_CALLS,    LOG_TASK_FAIL_MULTI_CALLS_TRANSFER,    LOG_TASK_FAIL_DETAIL,    LOG_TASK_FAIL_TRANSFER;}